function displayIceCreams(filteredIceCreams = iceCreams) {
    const container = document.getElementById("iceCreamContainer");
    container.innerHTML = "";
    
    filteredIceCreams.forEach(iceCream => {
        container.innerHTML += `
            <div class="bg-white p-4 rounded-lg shadow-lg text-center relative">
                <img src="${iceCream.image}" class="w-full rounded-lg" alt="${iceCream.name}">
                <h2 class="text-xl font-semibold mt-3">${iceCream.name}</h2>
                <p class="text-gray-600">${iceCream.price}</p>
                <button class="mt-2 bg-pink-500 text-white px-4 py-2 rounded-lg hover:bg-pink-600">Order Now</button>
            </div>
        `;
    });
}

document.getElementById("searchInput").addEventListener("input", function () {
    const query = this.value.toLowerCase();
    const filtered = iceCreams.filter(iceCream => iceCream.name.toLowerCase().includes(query));
    displayIceCreams(filtered);
});

displayIceCreams();